var axiosBackend = axios.create({
    baseURL: validateURL.URL(),
    timeout: 10000,
    headers: {
        "Content-Type": "application/json",
        'Accept': isWebpSupported() ? 'image/webp' : ''
    }
});

var BackendClient = {
    get(resource) {
        return axiosBackend.get(resource)
    },

    post(resource, payload = [], config = []) {
        return axiosBackend.post(resource, payload, config)
    },

    put() { },

    delete() { }
}

/**
 * Know if the browser support webp images.
 */
function isWebpSupported() {
    let elem = document.createElement('canvas');

    if (!!(elem.getContext && elem.getContext('2d'))) {
        // was able or not to get WebP representation
        return elem.toDataURL('image/webp').indexOf('data:image/webp') == 0;
    } else {
        // very old browser like IE 8, canvas not supported
        return false;
    }
}
//]]></script>
